'use client';

import { useField } from '@mui/x-date-pickers/internals';
import { useTimeRangeManager } from "../managers/index.js";
export const useSingleInputTimeRangeField = props => {
  const manager = useTimeRangeManager(props);
  return useField({
    manager,
    props
  });
};
